import { StyleSheet, View } from "react-native";

import HabitPage from "./components/HabitPage";

export default function App() {
  return (
    <View style={{ flex: 1 }}>
      <HabitPage></HabitPage>
    </View>
  );
}

const styles = StyleSheet.create({});
